import React, { Component } from 'react'

export default class IsLogin extends Component {
    render() {
        const user = this.props.user;
        if(user.isFormSubmit) {
            alert(user.token.msg)
        }
        return (
            <input type="submit" name="login" value="Log In" />
        )
    }
}
